import './styles.css';
import { useState } from 'react';
import { BrowserRouter, Routes, Route } from "react-router-dom";
import MainPage from "./pages/MainPage";

function App() {

  return (
    <div>
      <BrowserRouter>
        <Routes>
          <Route exact path="/" component={<MainPage />} />
        </Routes>
    </BrowserRouter>
    </div>
  );
}

export default App;
